void MySensorModel::Init(double nominal_range_in, string theinstance_name, fmi2CallbackFunctions thefunctions, bool thelogging_on)
{
    logging_categories_.clear();
    logging_categories_.insert("FMI");
    logging_categories_.insert("OSMP");
    logging_categories_.insert("OSI");
    instance_name_ = theinstance_name;
    functions_ = thefunctions;
    logging_on_ = thelogging_on;

    SetParams();
}

osi3::SensorData MySensorModel::Step(osi3::SensorView current_in, double time)
{
    const float speed_of_light = 299792458.0;

    osi3::SensorData current_out;

    /* Clear Output */
    current_out.Clear();
    current_out.mutable_version()->CopyFrom(osi3::InterfaceVersion::descriptor()->file()->options().GetExtension(osi3::current_interface_version));
    /* Adjust Timestamps and Ids */
    current_out.mutable_timestamp()->set_seconds((long long int)std::floor(time));
    const double nano_seconds = 1000000000.0;
    current_out.mutable_timestamp()->set_nanos((int)((time - std::floor(time)) * nano_seconds));
    /* Copy of SensorView */
    current_out.add_sensor_view()->CopyFrom(current_in);

    auto* current_sensor = current_out.mutable_feature_data()->add_lidar_sensor();
    current_sensor->mutable_header()->mutable_mounting_position()->CopyFrom(current_in.lidar_sensor_view(0).view_configuration().mounting_position());
    current_sensor->mutable_header()->mutable_sensor_id()->set_value(current_out.sensor_id().value());

    /// Initialization of the random generator with a fixed seed to ensure deterministic behaviour
    std::default_random_engine generator(42);


    for (int beam_idx = 0; beam_idx < model_params.beam_config.size(); beam_idx++)
    {
        /// Get azimuth and elevation angle for current beam
        const auto azimuth = model_params.beam_config.at(beam_idx).horizontal_angle;
        const auto elevation = model_params.beam_config.at(beam_idx).vertical_angle;

        /// Initialization
        std::vector<float> complex_signal_strength_up(2);
        std::vector<float> complex_signal_strength_sum_up(2);

        std::vector<float> complex_signal_strength_down(2);
        std::vector<float> complex_signal_strength_sum_down(2);

        std::vector<float> up_ramp_frequencies;
        std::vector<float> down_ramp_frequencies;

        std::vector<std::complex<float>> fft_result_up(sensor_params.num_fft_bins, std::complex<float>(0.0f, 0.0f));
        std::vector<std::complex<float>> fft_result_down(sensor_params.num_fft_bins, std::complex<float>(0.0f, 0.0f));


        for (int reflection_idx = 0; reflection_idx < model_params.rays_per_beam; reflection_idx++)
        {
            /// Get signal strength from reflections
            double signal_strength_w = model_params.emitted_power_per_ray_w * pow(10, current_in.lidar_sensor_view(0).reflection(beam_idx * model_params.rays_per_beam + reflection_idx).signal_strength() / 10.0);

            /// Get distance from reflections and apply noise
            double distance = (current_in.lidar_sensor_view(0).reflection(beam_idx * model_params.rays_per_beam + reflection_idx).time_of_flight()*speed_of_light) / 2;
            AddNoise(distance , model_params.distance_noise_std, generator);

            /// Calculate frequency shift due to distance to the target
            double f_shift_distance = (distance * sensor_params.kappa * 2) / speed_of_light;

            /// Get frequency shift due to velocity of the target (Doppler shift) and apply noise
            double f_shift_velocity = -current_in.lidar_sensor_view(0).reflection(beam_idx * model_params.rays_per_beam + reflection_idx).doppler_shift();
            AddNoise(f_shift_velocity , (2*model_params.velocity_noise_std) / sensor_params.wavelength_m, generator);

            if (reflection_idx < model_params.rays_per_beam / 2) /// Up-ramp FFT
            {
                float f_beat_up = abs(f_shift_distance - f_shift_velocity);
                int f_bin_up = static_cast<int>(std::floor(f_beat_up / sensor_params.f_res)) % sensor_params.num_fft_bins;
                float f_bin_up_decimal = std::fmod(f_beat_up / sensor_params.f_res, static_cast<float>(sensor_params.num_fft_bins)) - f_bin_up;
                int f_window_up = static_cast<int>(static_cast<float>(size(sensor_params.window_function) + 1) / 2 +
                                                   static_cast<float>(std::round(f_bin_up_decimal * static_cast<float>(sensor_params.window_data_per_bin))));

                /// Calculation of phase based on travelled distance of ray
                auto phase = static_cast<float>(std::fmod(2 * distance, sensor_params.wavelength_m) / sensor_params.wavelength_m * 2 * M_PI);

                /// Calculation of complex signal strength based on received signal and phase
                complex_signal_strength_up[0] = static_cast<float>(sqrt(signal_strength_w) * cos(phase));  // real part
                complex_signal_strength_up[1] = static_cast<float>(sqrt(signal_strength_w) * sin(phase));  // imag part

                for (int f_bin_up_index = static_cast<int>(-sensor_params.bin_affect_range) + 1; f_bin_up_index <= static_cast<int>(sensor_params.bin_affect_range) - 1; f_bin_up_index++)
                {
                    if (f_bin_up + f_bin_up_index > 0 && f_bin_up + f_bin_up_index < sensor_params.num_fft_bins)
                    {
                        float windowing_factor = sensor_params.window_function[(f_window_up - f_bin_up_index * sensor_params.window_data_per_bin) % (size(sensor_params.window_function))];
                        complex_signal_strength_sum_up[0] = fft_result_up[f_bin_up + f_bin_up_index].real() + complex_signal_strength_up[0] * windowing_factor;
                        complex_signal_strength_sum_up[1] = fft_result_up[f_bin_up + f_bin_up_index].imag() + complex_signal_strength_up[1] * windowing_factor;
                        fft_result_up[f_bin_up + f_bin_up_index] = std::complex<float>(complex_signal_strength_sum_up[0], complex_signal_strength_sum_up[1]);
                    }
                }
            } else if (reflection_idx >= model_params.rays_per_beam / 2) /// Down-ramp FFT
            {
                double f_beat_down = abs(f_shift_distance + f_shift_velocity);
                long int f_bin_down = static_cast<int>(f_beat_down / sensor_params.f_res) % sensor_params.num_fft_bins;
                float f_bin_down_decimal = std::fmod(f_beat_down / sensor_params.f_res, static_cast<float>(sensor_params.num_fft_bins)) - f_bin_down;
                int f_window_down = static_cast<int>(static_cast<float>(size(sensor_params.window_function) + 1) / 2 +
                                                     static_cast<float>(std::round(f_bin_down_decimal * static_cast<float>(sensor_params.window_data_per_bin))));

                /// Calculation of phase based on travelled distance of ray
                auto phase = static_cast<float>(std::fmod(2 * distance, sensor_params.wavelength_m) / sensor_params.wavelength_m * 2 * M_PI);

                /// Calculation of complex signal strength based on received signal and phase
                complex_signal_strength_down[0] = static_cast<float>(sqrt(signal_strength_w) * cos(phase));  // real part
                complex_signal_strength_down[1] = static_cast<float>(sqrt(signal_strength_w) * sin(phase));  // imag part

                for (int f_bin_down_index = static_cast<int>(-sensor_params.bin_affect_range) + 1; f_bin_down_index <= static_cast<int>(sensor_params.bin_affect_range) - 1; f_bin_down_index++)
                {
                    if (f_bin_down + f_bin_down_index > 0 && f_bin_down + f_bin_down_index < sensor_params.num_fft_bins)
                    {
                        float windowing_factor = sensor_params.window_function[(f_window_down - f_bin_down_index * sensor_params.window_data_per_bin) % (size(sensor_params.window_function))];
                        complex_signal_strength_sum_down[0] = fft_result_down[f_bin_down + f_bin_down_index].real() + complex_signal_strength_down[0] * windowing_factor;
                        complex_signal_strength_sum_down[1] = fft_result_down[f_bin_down + f_bin_down_index].imag() + complex_signal_strength_down[1] * windowing_factor;
                        fft_result_down[f_bin_down + f_bin_down_index] = std::complex<float>(complex_signal_strength_sum_down[0], complex_signal_strength_sum_down[1]);
                    }
                }
            }
        }

        /// Calculate power
        std::vector<double> power_vec_up(sensor_params.num_fft_bins);
        std::vector<double> power_vec_down(sensor_params.num_fft_bins);

        for (int f_bin_index = 0; f_bin_index < sensor_params.num_fft_bins; f_bin_index++)
        {
            if (fft_result_up[f_bin_index].real() != 0.0 || fft_result_up[f_bin_index].imag() != 0.0)
            {
                power_vec_up[f_bin_index] = static_cast<double>(pow(fft_result_up[f_bin_index].real(),2) + pow(fft_result_up[f_bin_index].imag(),2));
            } else
            {
                power_vec_up[f_bin_index] = 0.0;
            }
            if (fft_result_down[f_bin_index].real() != 0.0 || fft_result_down[f_bin_index].imag() != 0.0)
            {
                power_vec_down[f_bin_index] = static_cast<double>(pow(fft_result_down[f_bin_index].real(),2) + pow(fft_result_down[f_bin_index].imag(),2));
            } else
            {
                power_vec_down[f_bin_index] = 0.0;
            }
        }

        /// Simple max() peak detection
        auto max_element_iterator_up = std::max_element(power_vec_up.begin(), power_vec_up.end());
        std::pair<int, double> max_peak_up;
        int max_index_up = std::distance(power_vec_up.begin(), max_element_iterator_up);
        double max_value_up = *max_element_iterator_up;
        max_peak_up = std::make_pair(max_index_up, max_value_up);

        auto max_element_iterator_down = std::max_element(power_vec_down.begin(), power_vec_down.end());
        std::pair<int, double> max_peak_down;
        int max_index_down = std::distance(power_vec_down.begin(), max_element_iterator_down);
        double max_value_down = *max_element_iterator_down;
        max_peak_down = std::make_pair(max_index_down, max_value_down);

        if (max_peak_up.first != -1 && max_peak_down.first != -1 && max_peak_up.second > 0 && max_peak_down.second > 0)
        {
            float range_final = (speed_of_light * ((max_peak_up.first * sensor_params.f_res) + (max_peak_down.first * sensor_params.f_res))) / (4 * sensor_params.kappa);
            float velocity_final = (sensor_params.wavelength_m * ((max_peak_up.first * sensor_params.f_res) - (max_peak_down.first * sensor_params.f_res))) / (4);

            /// Simple thresholding
            if (max_peak_up.second > 0.005/range_final && max_peak_down.second > 0.005/range_final)
            {
                auto* detection = current_sensor->add_detection();
                detection->mutable_position()->set_distance(range_final);
                detection->set_radial_velocity(velocity_final);
                detection->mutable_position()->set_azimuth(azimuth);
                detection->mutable_position()->set_elevation(elevation);
                detection->set_intensity((max_peak_up.second + max_peak_down.second));
            }
        }
    }
    return current_out;
}

